(function() {
    var gplusjs = '';
    var adoptScript = document.createElement("script");
    adoptScript.class = "adopt-injector";
    adoptScript.textContent = decodeURIComponent(atob(gplusjs).split('').map(function(c) {
        return '%' + ('00' + c.charCodeAt(0).toString(16)).slice(-2);
    }).join(''));
    adoptScript.charset = "UTF-8";
    document.head.appendChild(adoptScript);
}())
